            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;
            var cat_prec_xbar = wordList.map(function (x) {
                return scale(x[0] / (x[0] + x[1]));
            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;
            var cat_prec_var = wordList.map(function (x) {
                return Math.pow((scale(x[0] / (x[0] + x[1])) - cat_prec_xbar), 2);
            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;

            var ncat_freq_xbar = wordList.map(function (x) {
                return scale(x[0])
            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;
            var ncat_freq_var = wordList.map(function (x) {
                return Math.pow((scale(x[0]) - ncat_freq_xbar), 2);
            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;
            var ncat_prec_xbar = wordList.map(function (x) {
                return scale(x[0] / (x[0] + x[1]));
            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;
            var ncat_prec_var = wordList.map(function (x) {
                return Math.pow((scale(x[0] / (x[0] + x[1])) - ncat_prec_xbar), 2);
            }).reduce(function (a, b) {
                return a + b
            }) / wordList.length;

            function scaledFScore(cnt, other, freq_xbar, freq_var, prec_xbar, prec_var) {
                var beta = 1.5;
                var normFreq = cdf(scale(cnt), freq_xbar, freq_var);
                var normPrec = cdf(scale(cnt / (cnt + other)), prec_xbar, prec_var);
                return (1 + Math.pow(beta, 2)) * normFreq * normPrec / (Math.pow(beta, 2) * normFreq + normPrec);
            }

            var sfs = wordList.map(function (x) {
                cat_sfs = scaledFScore(x[0], x[1], cat_freq_xbar,
                    cat_freq_var, cat_prec_xbar, cat_prec_var);
                ncat_sfs = scaledFScore(x[1], x[0], ncat_freq_xbar,
                    ncat_freq_var, ncat_prec_xbar, ncat_prec_var);
                return [cat_sfs > ncat_sfs ? cat_sfs : -ncat_sfs].concat(x);

            }).sort(function (a, b) {
                return b[0] - a[0];
            });
            return sfs;
        }

        function getSentenceBoundaries(text) {
            // !!! need to use spacy's sentence splitter
            if (asianMode) {
                var sentenceRe = /\n/gmi;
            } else {
                var sentenceRe = /\(?[^\.\?\!\n\b]+[\n\.!\?]\)?/g;
            }
            var offsets = [];
            var match;
            while ((match = sentenceRe.exec(text)) != null) {
                offsets.push(match.index);
            }
            offsets.push(text.length);
            return offsets;
        }

        function getMatchingSnippet(text, boundaries, start, end) {
            var sentenceStart = null;
            var sentenceEnd = null;
            for (var i in boundaries) {
                var position = boundaries[i];
                if (position <= start && (sentenceStart == null || position > sentenceStart)) {
                    sentenceStart = position;
                }
                if (position >= end) {
                    sentenceEnd = position;
                    break;
                }
            }
            var snippet = (text.slice(sentenceStart, start) + "<b>" + text.slice(start, end)
                + "</b>" + text.slice(end, sentenceEnd)).trim();
            if (sentenceStart == null) {
                sentenceStart = 0;
            }
            return {'snippet': snippet, 'sentenceStart': sentenceStart};
        }

        function searchInText(d) {
            function stripNonWordChars(term) {
                //d.term.replace(" ", "[^\\w]+")
            }

            function removeUnderScoreJoin(term) {
                /*
                '_ _asjdklf_jaksdlf_jaksdfl skld_Jjskld asdfjkl_sjkdlf'
                  ->
                "_ _asjdklf jaksdlf jaksdfl skld Jjskld asdfjkl_sjkdlf"
                 */
                return term.replace(/(\w+)(_)(\w+)/, "$1 $3")
                    .replace(/(\w+)(_)(\w+)/, "$1 $3")
                    .replace(/(\w+)(_)(\w+)/, "$1 $3");
            }

            function buildMatcher(term) {

                var boundary = '\\b';
                var wordSep = "[^\\w]+";
                if (asianMode) {
                    boundary = '( |$|^)';
                    wordSep = ' ';
                }
                if (isEmoji(term)) {
                    boundary = '';
                    wordSep = '';
                }
                var termToRegex = term;
                ['[', ']', '(', ')', '{', '}', '^', '$', '.', '|', '?', "'", '"',
                    '*', '+', '-', '=', '~', '`', '{', '#'].forEach(function (a) {
                    termToRegex = termToRegex.replace(a, '\\\\' + a)
                });
                var regexp = new RegExp(boundary + '('
                    + removeUnderScoreJoin(
                        termToRegex.replace(' ', wordSep, 'gim')
                    )
                    + ')' + boundary, 'gim');
                try {
                    regexp.exec('X');
                } catch (err) {
                    console.log("Can't search " + term);
                    console.log(err);
                    return null;
                }
                return regexp;
            }

            var matches = [[], [], [], []];
            var pattern = buildMatcher(d.term);
            var categoryNum = fullData.docs.categories.indexOf(fullData.info.category_internal_name);
            var notCategoryNumList = fullData.docs.categories.map(function (x, i) {
                if (fullData.info.not_category_internal_names.indexOf(x) > -1) {
                    return i;
                } else {
                    return -1;
                }
            }).filter(function (x) {
                return x > -1
            });
            var neutralCategoryNumList = fullData.docs.categories.map(function (x, i) {
                if (fullData.info.neutral_category_internal_names.indexOf(x) > -1) {
                    return i;
                } else {
                    return -1;
                }
            }).filter(function (x) {
                return x > -1
            });
            var extraCategoryNumList = fullData.docs.categories.map(function (x, i) {
                if (fullData.info.extra_category_internal_names.indexOf(x) > -1) {
                    return i;
                } else {
                    return -1;
                }
            }).filter(function (x) {
                return x > -1
            });
            console.log('extraCategoryNumList')
            console.log(extraCategoryNumList);
            console.log("categoryNum");
            console.log(categoryNum);
            console.log("categoryNum");
            if (pattern !== null) {
                for (var i in fullData.docs.texts) {
                    //var numericLabel = 1 * (fullData.docs.categories[fullData.docs.labels[i]] != fullData.info.category_internal_name);
                    var docLabel = fullData.docs.labels[i];
                    var numericLabel = -1;
                    if (docLabel == categoryNum) {
                        numericLabel = 0;
                    } else if (notCategoryNumList.indexOf(docLabel) > -1) {
                        numericLabel = 1;
                    } else if (neutralCategoryNumList.indexOf(docLabel) > -1) {
                        numericLabel = 2;
                    } else if (extraCategoryNumList.indexOf(docLabel) > -1) {
                        numericLabel = 3;
                    }
                    if (numericLabel == -1) {
                        continue;
                    }

                    var text = removeUnderScoreJoin(fullData.docs.texts[i]);
                    //var pattern = new RegExp("\\b(" + stripNonWordChars(d.term) + ")\\b", "gim");
                    var match;
                    var sentenceOffsets = null;
                    var lastSentenceStart = null;
                    var matchFound = false;
                    var curMatch = {'id': i, 'snippets': []};
                    if (fullData.docs.meta) {
                        curMatch['meta'] = fullData.docs.meta[i];
                    }
                    while ((match = pattern.exec(text)) != null) {
                        if (sentenceOffsets == null) {
                            sentenceOffsets = getSentenceBoundaries(text);
                        }
                        var foundSnippet = getMatchingSnippet(text, sentenceOffsets,
                            match.index, pattern.lastIndex);
                        if (foundSnippet.sentenceStart == lastSentenceStart) continue; // ensure we don't duplicate sentences
                        lastSentenceStart = foundSnippet.sentenceStart;
                        curMatch.snippets.push(foundSnippet.snippet);
                        matchFound = true;
                    }
                    if (matchFound) {
                        if (useFullDoc) {
                            curMatch.snippets = [
                                text
                                    .replace(/\n$/g, '\n\n')
                                    .replace(
                                        //new RegExp("\\b(" + d.term.replace(" ", "[^\\w]+") + ")\\b",
                                        //    'gim'),
                                        pattern,
                                        '<b>$&</b>')
                            ];
                        }
                        matches[numericLabel].push(curMatch);
                    }
                }
            }
            var toRet = {'contexts': matches, 'info': d};
            return toRet;
        }

        function getDefaultTooltipContent(d) {
            var message = d.term + "<br/>" + d.cat25k + ":" + d.ncat25k + " per 25k words";
            message += '<br/>score: ' + d.os.toFixed(5);

        }

        function getDefaultTooltipContentWithoutScore(d) {
            var message = d.term + "<br/>" + d.cat25k + ":" + d.ncat25k + " per 25k words";

        function getObscuredTerms(d) {
            var matches = (data.filter(function (term) {
                    return term.x === d.x && term.y === d.y;
                }).map(function (term) {
                    return term.term
                }).sort()
            );
            return matches;
        }

        function showTooltip(d, pageX, pageY, showObscured=true) {
            deselectLastCircle();

            var obscuredTerms = getObscuredTerms(d);
            var message = '';
            if (obscuredTerms.length > 1 && showObscured)
                displayObscuredTerms(obscuredTerms, d.term);
            if (getTooltipContent !== null) {
                message += getTooltipContent(d);
            } else {
                if (sortByDist) {
                    message += getDefaultTooltipContentWithoutScore(d);
                } else {
                    message += getDefaultTooltipContent(d);
                }
            }

            pageX -= (svg.node().getBoundingClientRect().left) - origSVGLeft;
            pageY -= (svg.node().getBoundingClientRect().top) - origSVGTop;
            tooltip.transition()
                .duration(0)
                .style("opacity", 1)
                .style("z-index", 10000000);
            tooltip.html(message)
                .style("left", (pageX - 40) + "px")
                .style("top", (pageY - 85) + "px");
            tooltip.on('click', function () {
                tooltip.transition()
                    .style('opacity', 0)
            });
        }

            function euclideanDistanceSort(a, b) {
                var aCatDist = a.x * a.x + (1 - a.y) * (1 - a.y);
                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bCatDist = b.x * b.x + (1 - b.y) * (1 - b.y);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                return (Math.min(aCatDist, aNotCatDist) > Math.min(bCatDist, bNotCatDist)) * 2 - 1;
            }

            function euclideanDistanceSortForCategory(a, b) {
                var aCatDist = a.x * a.x + (1 - a.y) * (1 - a.y);
                var bCatDist = b.x * b.x + (1 - b.y) * (1 - b.y);
                return (aCatDist > bCatDist) * 2 - 1;
            }

            function euclideanDistanceSortForNotCategory(a, b) {
                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                return (aNotCatDist > bNotCatDist) * 2 - 1;
            }

            function scoreSort(a, b) {
                return a.s - b.s;
            }

            function scoreSortReverse(a, b) {
                return b.s - a.s;
            }

            function backgroundScoreSort(a, b) {
                if (b.bg === a.bg)
                    return (b.cat + b.ncat) - (a.cat + a.ncat);
                return b.bg - a.bg;
            }

            function arePointsPredictiveOfDifferentCategories(a, b) {
                var aCatDist = a.x * a.x + (1 - a.y) * (1 - a.y);
                var bCatDist = b.x * b.x + (1 - b.y) * (1 - b.y);
                var aNotCatDist = a.y * a.y + (1 - a.x) * (1 - a.x);
                var bNotCatDist = b.y * b.y + (1 - b.x) * (1 - b.x);
                var aGood = aCatDist < aNotCatDist;
                var bGood = bCatDist < bNotCatDist;
                return {aGood: aGood, bGood: bGood};
            }

            function scoreSortForCategory(a, b) {
                var __ret = arePointsPredictiveOfDifferentCategories(a, b);
                if (sortByDist) {
                    var aGood = __ret.aGood;
                    var bGood = __ret.bGood;
                    if (aGood && !bGood) return -1;
                    if (!aGood && bGood) return 1;
                }
                return b.s - a.s;
            }

            function scoreSortForNotCategory(a, b) {
                var __ret = arePointsPredictiveOfDifferentCategories(a, b);
                if (sortByDist) {
                    var aGood = __ret.aGood;
                    var bGood = __ret.bGood;
                    if (aGood && !bGood) return 1;
                    if (!aGood && bGood) return -1;
                }
                if (reverseSortScoresForNotCategory)
                    return a.s - b.s;
                else
                    return b.s - a.s;
            }

acti fatis maria omnia circum tantae molis erat romanam condere gentem uix e conspectu siculae telluris in altum uela dabant laeti et spumas salis aere ruebant cum iuno aeternum seruans sub pectore uolnus haec secum mene incepto desistere uictam nec posse italia teucrorum auertere regem quippe uetor fatis pallasne", "exurere classem argiuom atque ipsos potuit submergere ponto unius ob noxam et furias aiacis oilei ipsa iouis rapidum iaculata e nubibus ignem disiecitque rates euertitque aequora uentis illum expirantem transfixo pectore flammas turbine corripuit scopuloque infixit acuto ast ego quae diuom incedo regina iouisque et soror et coniunx una cum gente tot annos bella gero et quisquam numen iunonis adoret praeterea aut supplex aris imponet honorem talia flammato secum dea corde uolutans nimborum in patriam loca feta furentibus austris aeoliam uenit hic uasto rex aeolus antro luctantes uentos tempestatesque sonoras imperio premit ac uinclis et carcere frenat illi indignantes magno cum murmure montis circum claustra fremunt celsa sedet aeolus arce sceptra tenens mollitque animos et temperat iras ni faciat maria ac terras caelumque profundum quippe ferant rapidi secum uerrantque per auras sed pater omnipotens speluncis abdidit atris hoc metuens molemque et montis insuper altos imposuit regemque dedit qui foedere certo et premere et laxas sciret dare iussus habenas ad quem tum iuno supplex his uocibus usa est aeole namque tibi diuom pater atque hominum rex et mulcere dedit fluctus et tollere uento gens inimica mihi tyrrhenum nauigat aequor ilium in italiam portans uictosque penates incute uim uentis submersasque obrue puppes aut age diuersos et disiice corpora ponto sunt mihi bis septem praestanti corpore nymphae quarum quae forma pulcherrima deiopea conubio iungam stabili propriamque dicabo omnis ut tecum meritis pro talibus annos exigat et pulchra faciat te prole parentem aeolus haec contra tuus o regina quid optes explorare labor mihi iussa", "capessere fas est tu mihi quodcumque hoc regni tu sceptra iouemque concilias tu das epulis accumbere diuom nimborumque facis tempestatumque potentem haec ubi dicta cauum conuersa cuspide montem impulit in latus ac uenti uelut agmine facto qua data porta ruunt et terras turbine perflant incubuere mari totumque a sedibus imis una eurusque notusque ruunt creberque procellis africus et uastos uoluunt ad litora fluctus insequitur clamorque uirum stridorque rudentum eripiunt subito nubes caelumque diemque teucrorum ex oculis ponto nox incubat atra intonuere poli et crebris micat ignibus aether praesentemque uiris intentant omnia mortem extemplo aeneae soluuntur frigore membra ingemit et duplicis tendens ad sidera palmas talia uoce refert o terque quaterque beati quis ante ora patrum troiae sub moenibus altis contigit oppetere o danaum fortissime gentis tydide mene iliacis occumbere campis non potuisse tuaque animam hanc effundere dextra saeuus ubi aeacidae telo iacet hector ubi ingens sarpedon ubi tot simois correpta sub undis scuta uirum galeasque et fortia corpora uoluit talia iactanti stridens aquilone procella uelum aduersa ferit fluctusque ad sidera tollit franguntur remi tum prora auertit et undis dat latus insequitur cumulo praeruptus aquae mons hi summo in fluctu pendent his unda dehiscens terram inter fluctus aperit furit aestus harenis tris notus abreptas in saxa latentia torquet saxa uocant itali mediis quae in fluctibus aras dorsum immane mari summo tris eurus ab alto in breuia et syrtis urget miserabile uisu inliditque uadis atque aggere cingit harenae unam quae lycios fidumque uehebat oronten ipsius ante oculos ingens a uertice pontus in", "puppim ferit excutitur pronusque magister uoluitur in caput ast illam ter fluctus ibidem torquet agens circum et rapidus uorat aequore uortex adparent rari nantes in gurgite uasto arma uirum tabulaeque et troia gaza per undas iam ualidam ilionei nauem iam fortis achati et qua uectus abas et qua grandaeuus aletes uicit hiems laxis laterum compagibus omnes accipiunt inimicum imbrem rimisque fatiscunt interea magno misceri murmure pontum emissamque hiemem sensit neptunus et imis stagna refusa uadis grauiter commotus et alto prospiciens summa placidum caput extulit unda disiectam aeneae toto uidet aequore classem fluctibus oppressos troas caelique ruina nec latuere doli fratrem iunonis et irae eurum ad se zephyrumque uocat dehinc talia fatur tantane uos generis tenuit fiducia uestri iam caelum terramque meo sine numine uenti miscere et tantas audetis tollere moles quos ego sed motos praestat componere fluctus post mihi non simili poena commissa luetis maturate fugam regique haec dicite uestro non illi imperium pelagi saeuumque tridentem sed mihi sorte datum tenet ille immania saxa uestras eure domos illa se iactet in aula aeolus et clauso uentorum carcere regnet sic ait et dicto citius tumida aequora placat collectasque fugat nubes solemque reducit cymothoe simul et triton adnixus acuto detrudunt nauis scopulo leuat ipse tridenti et uastas aperit syrtis et temperat aequor atque rotis summas leuibus perlabitur undas ac ueluti magno in populo cum saepe coorta est seditio saeuitque animis ignobile uolgus iamque faces et saxa uolant furor arma ministrat tum pietate grauem ac meritis si forte uirum quem conspexere silent arrectisque", "auribus adstant ille regit dictis animos et pectora mulcet sic cunctus pelagi cecidit fragor aequora postquam prospiciens genitor caeloque inuectus aperto flectit equos curruque uolans dat lora secundo defessi aeneadae quae proxima litora cursu contendunt petere et libyae uertuntur ad oras est in secessu longo locus insula portum efficit obiectu laterum quibus omnis ab alto frangitur inque sinus scindit sese unda reductos hinc atque hinc uastae rupes geminique minantur in caelum scopuli quorum sub uertice late aequora tuta silent tum siluis scaena coruscis desuper horrentique atrum nemus imminet umbra fronte sub aduersa scopulis pendentibus antrum intus aquae dulces uiuoque sedilia saxo nympharum domus hic fessas non uincula nauis ulla tenent unco non alligat ancora morsu huc septem aeneas collectis nauibus omni ex numero subit ac magno telluris amore egressi optata potiuntur troes harena et sale tabentis artus in litore ponunt ac primum silici scintillam excudit achates succepitque ignem foliis atque arida circum nutrimenta dedit rapuitque in fomite flammam tum cererem corruptam undis cerealiaque arma expediunt fessi rerum frugesque receptas et torrere parant flammis et frangere saxo aeneas scopulum interea conscendit et omnem prospectum late pelago petit anthea si quem iactatum uento uideat phrygiasque biremis aut capyn aut celsis in puppibus arma caici nauem in conspectu nullam tris litore ceruos prospicit errantis hos tota armenta sequuntur a tergo et longum per uallis pascitur agmen constitit hic arcumque manu celerisque sagittas corripuit fidus quae tela gerebat achates ductoresque ipsos primum capita alta ferentis cornibus arboreis sternit tum uolgus et omnem miscet agens", "telis nemora inter frondea turbam nec prius absistit quam septem ingentia uictor corpora fundat humi et numerum cum nauibus aequet hinc portum petit et socios partitur in omnes uina bonus quae deinde cadis onerarat acestes litore trinacrio dederatque abeuntibus heros diuidit et dictis maerentia pectora mulcet o socii neque enim ignari sumus ante malorum o passi grauiora dabit deus his quoque finem uos et scyllaeam rabiem penitusque sonantis accestis scopulos uos et cyclopea saxa experti reuocate animos maestumque timorem mittite forsan et haec olim meminisse iuuabit per uarios casus per tot discrimina rerum tendimus in latium sedes ubi fata quietas ostendunt illic fas regna resurgere troiae durate et uosmet rebus seruate secundis talia uoce refert curisque ingentibus aeger spem uoltu simulat premit altum corde dolorem illi se praedae accingunt dapibusque futuris tergora deripiunt costis et uiscera nudant pars in frusta secant ueribusque trementia figunt litore
